public class InnerDataSourceDataSourceConfigurationInputFactory(Action<Humidifier.DataZone.DataSourceTypes.DataSourceConfigurationInput> factoryAction = null) : SubResourceFactory<Humidifier.DataZone.DataSourceTypes.DataSourceConfigurationInput>
{

    internal InnerDataSourceRedshiftRunConfigurationInputFactory RedshiftRunConfigurationFactory { get; set; }

    internal InnerDataSourceGlueRunConfigurationInputFactory GlueRunConfigurationFactory { get; set; }

    protected override Humidifier.DataZone.DataSourceTypes.DataSourceConfigurationInput Create()
    {
        var dataSourceConfigurationInputResult = CreateDataSourceConfigurationInput();
        factoryAction?.Invoke(dataSourceConfigurationInputResult);

        return dataSourceConfigurationInputResult;
    }

    private Humidifier.DataZone.DataSourceTypes.DataSourceConfigurationInput CreateDataSourceConfigurationInput()
    {
        var dataSourceConfigurationInputResult = new Humidifier.DataZone.DataSourceTypes.DataSourceConfigurationInput();

        return dataSourceConfigurationInputResult;
    }
    public override void CreateChildren(Humidifier.DataZone.DataSourceTypes.DataSourceConfigurationInput result)
    {
        base.CreateChildren(result);

        result.RedshiftRunConfiguration ??= RedshiftRunConfigurationFactory?.Build();
        result.GlueRunConfiguration ??= GlueRunConfigurationFactory?.Build();
    }

} // End Of Class

